con:config.script:
import com.eviware.soapui.support.GroovyUtils
// read values from property set
def email= context.expand('${Properties#email}')
def firstname= context.expand('${Properties#firstname}')
def lastname= context.expand('${Properties#lastname}')
//get names of test suit,test case and teststep
def StepName = context.getCurrentStep().name
def TcName = context.getTestCase().name
def TestSuiteName = context.getTestCase().getTestSuite().name  

//get request xml
def reqXML = context.expand('${AddNewCustomer#Request}') 
//set counter for email value from property
def number =testRunner.testCase.getTestStepByName("Properties").getPropertyValue("counter")
def newnumber = number+1
def joinemail = email + newnumber + "@gmail.com"
testRunner.testCase.getTestStepByName("Properties").setPropertyValue("counter",newnumber)

//set email,firstname and lastname values form property into request xml
def gutil = new GroovyUtils(context)
def xmlHolder = gutil.getXmlHolder(reqXML)
xmlHolder.namespaces = "http://soap.upskills.in/soap/default?services=customerCustomerRepositoryV1"
xmlHolder.setNodeValue("//email",joinemail)
xmlHolder.setNodeValue("//firstname",firstname)
xmlHolder.setNodeValue("//lastname",lastname)
//get modified request xml
def ModifiedreqXML = xmlHolder.getXml()
//set modified request xml in request property in property set
testRunner.testCase.getTestStepByName("AddNewCustomer").setPropertyValue("Request",ModifiedreqXML)
// Add new customer
testRunner.testCase.testSuite.project.testSuites[TestSuiteName].testCases[TcName].testSteps["AddNewCustomer"].run(testRunner,context)
//fetch new created id from response xml and save it to property 
def resXML = context.expand('${AddNewCustomer#Response}') 
def resxmlHolder = gutil.getXmlHolder(resXML)
resxmlHolder.namespaces = "http://soap.upskills.in/soap/default?services=customerCustomerRepositoryV1"
def newresid=resxmlHolder.getNodeValue("//id")
testRunner.testCase.getTestStepByName("Properties").setPropertyValue("id",newresid)

//Get list of all customers
testRunner.testCase.testSuite.project.testSuites[TestSuiteName].testCases[TcName].testSteps["GetListofAllCustomers"].run(testRunner,context)

//set id value form property in request xml
def id=context.expand('${Properties#id}')
def reqXML1 = context.expand('${GetCustomerByID#Request}') 
def xmlHolder1 = gutil.getXmlHolder(reqXML1)
xmlHolder1.namespaces = "http://soap.upskills.in/soap/default?services=customerCustomerRepositoryV1"
xmlHolder1.setNodeValue("//customerId",id)
//get modified request xml
def ModifiedreqXML1 = xmlHolder1.getXml()
//set modified  request xml in request property in property set
testRunner.testCase.getTestStepByName("GetCustomerByID").setPropertyValue("Request",ModifiedreqXML1)
//Get customer by ID
testRunner.testCase.testSuite.project.testSuites[TestSuiteName].testCases[TcName].testSteps["GetCustomerByID"].run(testRunner,context)

//set id value form property in request xml
def reqXML2 = context.expand('${DeleteCustomerByID#Request}') 
def xmlHolder2 = gutil.getXmlHolder(reqXML2)
xmlHolder2.namespaces = "http://soap.upskills.in/soap/default?services=customerCustomerRepositoryV1"
xmlHolder2.setNodeValue("//customerId",id)
//get modified request xml
def ModifiedreqXML2 = xmlHolder2.getXml()
//set modified  request xml in request property in property set
testRunner.testCase.getTestStepByName("DeleteCustomerByID").setPropertyValue("Request",ModifiedreqXML2)
//Delete customer by ID
testRunner.testCase.testSuite.project.testSuites[TestSuiteName].testCases[TcName].testSteps["DeleteCustomerByID"].run(testRunner,context)
